<!DOCTYPE html>
<html>
    <head>
        <title>SVG Tim</title>

        <style type="text/css">
        html, body {
            width: 100%;
            height: 100%;
        }
        body.contained > svg {
            width: 100%;
            height: 100%;
        }
        body > svg .node ellipse {
            fill: #DDD;
            stroke: none;
        }
        body > svg .node-selected ellipse {
            fill: #004a97;
        }
        body > svg .node-selected text {
            fill: white;
            font-weight: bold;
        }
        </style>

        <script type="text/javascript">
        (function() {

            var intervalId;

            function bootstrap() {
                var svgElement = document.querySelector('body > svg');
                var graph = svgElement.getElementById('graph0');
                animate(graph, 100);
            }

            // Animate the graph using the given stepDuration (milliseconds).
            function animate(graph, stepDuration) {
                var nodes = graph.querySelectorAll('.node');
                console.log(nodes);
                maxIdx = nodes.length-1
                var idx = maxIdx;

                function step() {
                    nodes[idx].setAttribute('class', 'node');
                    idx = (idx < maxIdx ? idx + 1 : 0);
                    nodes[idx].setAttribute('class', 'node node-selected');
                    console.log(nodes[idx]);
                }

                step();
                intervalId = setInterval(step, stepDuration);

            }

            window.addEventListener('load', bootstrap, false);
        }());
        </script>
    </head>
